import React from 'react';
import './styles.scss';
import { formatDate } from '../../utils/helpers';

const Experience = () => {
  const experiences = [
    {
      company: 'PT Nusantara Digital Inovasi',
      position: 'Web Developer',
      startDate: '2023',
      endDate: 'Present',
      description: 'Mengembangkan dan memelihara aplikasi web menggunakan React dan Node.js. Berkolaborasi dengan tim desain dan backend untuk mengimplementasikan fitur baru.'
    },
    {
      company: 'PT Solusi Digital Teknologi',
      position: 'Junior Web Developer',
      startDate: '2022',
      endDate: '2023',
      description: 'Membangun antarmuka pengguna responsif menggunakan HTML, CSS, dan JavaScript. Mengintegrasikan API dan mengelola state aplikasi dengan React.'
    }
  ];

  return (
    <section className="experience" id="experience">
      <div className="container">
        <h2 className="section-title">Experience</h2>
        <div className="experience__timeline">
          {experiences.map((exp, index) => (
            <div key={index} className="experience__item">
              <h3>{exp.position}</h3>
              <h4>{exp.company}</h4>
              <p className="date">
                {formatDate(exp.startDate)} - {exp.endDate}
              </p>
              <p>{exp.description}</p>
            </div>
          ))}
        </div>
      </div>
    </section>
  );
};

export default Experience;
